// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MailLogRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.MailLog) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMailLogByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMailLogUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMailLogByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailLogUnscopedByIDPrefix, item.ID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
